import React, { useState, useRef, useEffect } from 'react';
import '../styles/SearchPlaceComponent.css';

const SearchPlaceComponent = ({ setDestination }) => {
  const [autocomplete, setAutocomplete] = useState(null);
  const inputRef = useRef(null);
  const mapRef = useRef(null);
  const markerRef = useRef(null);
  const polygonRef = useRef(null);

  useEffect(() => {
    if (!window.google || !window.google.maps) {
      console.error('Google Maps JavaScript API library must be loaded.');
      return;
    }

    const initializeAutocomplete = () => {
      const input = inputRef.current;
      const autocomplete = new window.google.maps.places.Autocomplete(input);
      autocomplete.setFields(['geometry', 'address_components']);
      autocomplete.addListener('place_changed', () => onPlaceChanged(autocomplete));
      setAutocomplete(autocomplete);
    };

    const initializeMap = () => {
      const defaultLocation = { lat: 20.5937, lng: 78.9629 }; // Coordinates for India
      const map = new window.google.maps.Map(mapRef.current, {
        center: defaultLocation,
        zoom: 5,
      });
      mapRef.current = map;

      const bounds = new window.google.maps.LatLngBounds(
        { lat: 6.4627, lng: 68.1097 }, // Southwest coordinates of India
        { lat: 35.5087, lng: 97.3954 }  // Northeast coordinates of India
      );

      const polygonCoords = [
        { lat: bounds.getNorthEast().lat(), lng: bounds.getNorthEast().lng() },
        { lat: bounds.getNorthEast().lat(), lng: bounds.getSouthWest().lng() },
        { lat: bounds.getSouthWest().lat(), lng: bounds.getSouthWest().lng() },
        { lat: bounds.getSouthWest().lat(), lng: bounds.getNorthEast().lng() },
      ];

      const polygon = new window.google.maps.Polygon({
        paths: polygonCoords,
        strokeColor: '#FF0000',
        strokeOpacity: 0.8,
        strokeWeight: 2,
        fillColor: '#FF0000',
        fillOpacity: 0.35,
      });

      polygon.setMap(map);
      polygonRef.current = polygon;

      // Adding custom markers at vertices
      polygonCoords.forEach((coord) => {
        new window.google.maps.Marker({
          position: coord,
          map: map,
          icon: 'URL_TO_CUSTOM_ICON', // Add URL to your custom icon
        });
      });

      // Adding label
      const label = new window.google.maps.InfoWindow({
        content: 'India',
        position: bounds.getCenter(),
      });
      label.open(map);
    };

    initializeAutocomplete();
    initializeMap();
  }, []);

  const onPlaceChanged = (autocomplete) => {
    const place = autocomplete.getPlace();

    if (!place.geometry) {
      console.error('Place contains no geometry');
      return;
    }

    const location = place.geometry.location;
    setDestination({
      latitude: location.lat(),
      longitude: location.lng(),
      viewport: {
        north: place.geometry.viewport.getNorthEast().lat(),
        east: place.geometry.viewport.getNorthEast().lng(),
        south: place.geometry.viewport.getSouthWest().lat(),
        west: place.geometry.viewport.getSouthWest().lng(),
      },
    });

    const map = new window.google.maps.Map(mapRef.current, {
      center: location,
      zoom: 15,
    });

    if (markerRef.current) {
      markerRef.current.setMap(null);
    }

    const marker = new window.google.maps.Marker({
      position: location,
      map: map,
    });
    markerRef.current = marker;

    if (polygonRef.current) {
      polygonRef.current.setMap(null);
    }

    const bounds = new window.google.maps.LatLngBounds(
      place.geometry.viewport.getSouthWest(),
      place.geometry.viewport.getNorthEast()
    );

    const polygonCoords = [
      { lat: bounds.getNorthEast().lat(), lng: bounds.getNorthEast().lng() },
      { lat: bounds.getNorthEast().lat(), lng: bounds.getSouthWest().lng() },
      { lat: bounds.getSouthWest().lat(), lng: bounds.getSouthWest().lng() },
      { lat: bounds.getSouthWest().lat(), lng: bounds.getNorthEast().lng() },
    ];

    const polygon = new window.google.maps.Polygon({
      paths: polygonCoords,
      strokeColor: '#FF0000',
      strokeOpacity: 0.8,
      strokeWeight: 2,
      fillColor: '#FF0000',
      fillOpacity: 0.35,
    });

    polygon.setMap(map);
    polygonRef.current = polygon;

    // Adding custom markers at vertices
    polygonCoords.forEach((coord) => {
      new window.google.maps.Marker({
        position: coord,
        map: map,
        icon: 'https://cdn-icons-png.flaticon.com/512/7527/7527064.png', // Add URL to your custom icon
      });
    });

    // Adding label
    const label = new window.google.maps.InfoWindow({
      content: 'Area Name',
      position: bounds.getCenter(),
    });
    label.open(map);

    // Adding info window on polygon click
    polygon.addListener('click', (event) => {
      const infoWindow = new window.google.maps.InfoWindow({
        content: 'Additional information here',
        position: event.latLng,
      });
      infoWindow.open(map);
    });
  };

  return (
    <div className="search-place-container">
      <input
        type="text"
        ref={inputRef}
        className="search-place-input"
        placeholder="Search for a place"
      />
      <div id="map" ref={mapRef} className="map-container"></div>
    </div>
  );
};

export default SearchPlaceComponent;
